import {Container,Vmenu,Vperfil,Vsino,Titulo, SubContainer} from "./Style";
import ImagemMenu from "../../imagens/Menu.png";
import ImagemSino from "../../imagens/Sino.png" ;
import ImagemPerfil from "../../imagens/Perfil.png" ;
import { useState } from "react";


const Header =({toggleMenu, isOpen}) => {
   
    const [isHovered, setIsHovered] = useState(false);

    const handleMouseEnter = () => {
      setIsHovered(true);
    };
  
    const handleMouseLeave = () => {
      setIsHovered(false);
    };
  
    return(
        <Container>
            <SubContainer>
                <Vmenu
                    onClick={toggleMenu}
                    className={`botao-menu ${isOpen ? "ativo" : ""} ${isHovered ? "hover" : ""}`}
                    onMouseEnter={handleMouseEnter}
                    onMouseLeave={handleMouseLeave}
                >
                    <img src={ImagemMenu}
                        alt="ImagemMenu"
                    />
                </Vmenu> 
                <Titulo>Home</Titulo>
            </SubContainer>
            <SubContainer></SubContainer>
            <SubContainer></SubContainer>
            <SubContainer>
                <Vsino>
                    <img 
                        src={ImagemSino}
                        alt="ImagemSino"/>
                </Vsino>
                <Vperfil><img src={ImagemPerfil} alt="ImagemPerfil"/></Vperfil>
            </SubContainer>
        </Container>
    )
};

export default Header;
